import React from 'react';
import { Table, Button } from 'react-bootstrap';

const AdminPanel = ({ users, onEdit, onDelete }) => {
  return (
    <div className="admin-panel">
      <h2>Панель администратора</h2>
      <Table striped bordered hover>
        <thead>
          <tr>
            <th>ID</th>
            <th>Имя пользователя</th>
            <th>Роль</th>
            <th>Действия</th>
          </tr>
        </thead>
        <tbody>
          {users.map(user => (
            <tr key={user.id}>
              <td>{user.id}</td>
              <td>{user.username}</td>
              <td>{user.role}</td>
              <td>
                <Button variant="primary" onClick={() => onEdit(user)}>Изменить</Button>{' '}
                <Button variant="danger" onClick={() => onDelete(user)}>Удалить</Button>
              </td>
            </tr>
          ))}
        </tbody>
      </Table>
    </div>
  );
};

export default AdminPanel;
